import { StyleSheet, Text, View } from 'react-native'
import React from 'react'
import {NavigationContainer} from '@react-navigation/native';
import Tab from './Tab';

 export default function Home () {
  return (
    <NavigationContainer>
      <Tab />
    </NavigationContainer>
  )
}
